import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import { Grid } from '@material-ui/core';

const useStyles = makeStyles({
  root: {
    maxWidth: 345,
    paddingBottom: "40px"
  },
  media: {
    height: 280,
  },
  signal: {
    margin: 'auto',
    backgroundColor: "#cddc39",
    },
});

export default function PersonCard() {
  const classes = useStyles();

  return (
    <React.Fragment>
        <Grid container justify="space-around" >
            <Grid className={classes.cardContainer} item xs={11} md={5}>
                <Card className={classes.root}>
                    <CardActionArea>
                        <CardMedia
                        className={classes.media}
                        image="https://starrgate.s3.amazonaws.com:443/users/5782a70d576d656e7c32341da803307f93792696/profile_jvxh0wK.jpg"
                        title="Contemplative Reptile"
                        />
                        <CardContent>
                        <Typography gutterBottom variant="h5" component="h2">
                            Lizard
                        </Typography>
                        <Typography variant="body2" color="textSecondary" component="p">
                            Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
                            across all continents except Antarctica
                        </Typography>
                        </CardContent>
                    </CardActionArea>
                    <CardActions>
                        <Button className={classes.signal} variant="contained">Signal</Button>
                    </CardActions>
                </Card>
            </Grid>
        </Grid>

    </React.Fragment>

  );
}
